  public function index() {
    $this->load->view('welcome_message');
  }

  public function login() {
    $data['APP']['title'] = 'iKarangguni';
    $this->load->view('login_to_continue', $data);
  }

  public function face() {

    require_once $_SERVER['DOCUMENT_ROOT'] . '/application/third_party/gravatar_helper/1.3.0/helpers/gravatar_helper.php';

    $fields = $_REQUEST;

    if (!isset($fields['user_id'])) {

      if (!$this->ion_auth->logged_in()) {
        return $this->login();
      }

      $fields['user_id'] = $this->session->userdata('user_id');
    }

    $user = $this->user_library->get_user($fields);


    $user['gravatar'] = Gravatar_helper::from_email($user['email']);

    $_binary_data = file_get_contents($user['gravatar']);


    $_I1R_URL['ProcessImageOnly'] = 'http://spdc.i2r.a-star.edu.sg/rest/my3dface_c/ProcessImageOnly?';
    $_I1R_URL['GetPreviousImage'] = 'http://spdc.i2r.a-star.edu.sg/rest/my3dface_c/GetPreviousImage?';

    $_FILENAME = md5($user['email']) .time();

    $_ProcessImageOnly['fName'] = $_FILENAME . '.jpg';
    $_ProcessImageOnly['b64String'] = base64_encode($_binary_data);
    $_ProcessImageOnly['hatIndex'] = 1;

    // 
    // ProcessImageOnly
    //
    $result = $this->CURL_POST($_I1R_URL['ProcessImageOnly'], $_ProcessImageOnly);

    if (strpos($result, 'Viola Jones face')) {
      die('Your profile image is not supported. Please change your gravatar profile image.');
    }

    $result = json_decode($result);

    $_GetPreviousImage['fName'] = $_ProcessImageOnly['fName'];
    $_GetPreviousImage['key'] = $result->key;

    // 
    // GetPreviousImage
    // 
    $result = $this->CURL_POST($_I1R_URL['GetPreviousImage'], $_GetPreviousImage);

    $result = json_decode($result);

